import React from 'react';
import logo from './images/logo.svg';
import circle from './images/circke.png';

function PortfolioPage() {
  return (
    <main className="flex-shrink-0">
      <div className="container-fluid">
        <nav className="nav navbar navbar-expand-lg bg-body-tertiary">
          <div className="col d-flex">
            <div className="col">
              <img src={logo} width="127" alt="Logo" />
            </div>
            <div className="right-aligned text-end">
              <img src={circle} width="150" alt="Circle Image" />
            </div>
          </div>
        </nav>
        <div className="content text-center row col-sm-12 col-xxl-8 col-xl-8 col-lg-8 col-md-8" style={{ margin: '0 auto' }}>
          <svg viewBox="0 0 1225 630" fill="none" xmlns="http://www.w3.org/2000/svg" id="hero">
            <g clipPath="url(#clip0_272_63)">
              {/* ... SVG path elements go here ... */}
            </g>
          </svg>
        </div>
      </div>
      <div className="footer mt-auto py-3" style={{ backgroundColor: '#EF5DA8' }}>
     <div class="container text-center">

     </div>
    </div>
    </main>

  );
}

export default PortfolioPage;
